import React from 'react'
import styled from 'styled-components'

const Mundo = () => {
  return (
    <GraficoWave>
      <div className="curve"></div>
    </GraficoWave>
  )
}

export default Mundo

const GraficoWave = styled.div`
  position: relative;
    .curve{
    position: absolute;
    height: 22rem;
    width: 100%;
    bottom: 0;
  }
  .curve::before{
      content: "";
      display: block;
      position: absolute;
      border-radius: 100% 50%;
      width: 55%;
      height: 100%;
      background-color: #fff;
      transform: translate(85%, 60%);
    }
  .curve::after{
      content: "";
      display: block;
      position: absolute;
      border-radius: 100% 50%;
      width: 55%;
      height: 100%;
      background-color: #2B3240;
      transform: translate(-4%, 40%);
      z-index: -1;
    } 
`
